CREATE TABLE productividad_data (
    ID_unidad_tfecha VARCHAR(255),
    Año INT,
    Fecha DATE,
    Mes_num TINYINT,
    Trimestre VARCHAR(10),
    Clues VARCHAR(50),
    Jurisdiccion VARCHAR(100),
    Mes VARCHAR(50),
    Municipio VARCHAR(100),
    Unidad VARCHAR(100),
    Turno VARCHAR(50),
    Localidad VARCHAR(50),
    Consultorios_Medicos INT,
    Tipologia VARCHAR(100),
    Aportacion_de_nucleos FLOAT,
    Medicos_Turno INT,
    Nucleos_por_turno INT,
    Razon_nuclear_turno FLOAT,
    JornadasxUnidad INT,
    Remover FLOAT,
    Consultas_de_unidad INT
);

